// implement Rating component here
import React from 'react';
import PropTypes from 'prop-types';

function Rating(props) {
  const { nota } = props;
  return (
    <section>
      Rating: { nota }
    </section>
  );
}

Rating.propTypes = {
  nota: PropTypes.number.isRequired,
};

export default Rating;
